import './App.css';
import React, { Fragment, useState } from 'react';
import RowName from "./component/RowName";
import RowDate from "./component/RowDate";
import RowContext from "./component/RowContext";
import SendBtn from "./component/SendBtn";

function App() {
  const [context, setContext] = useState("");
  const [name, setName] = useState("");
  const [regDate, setRegDate] = useState("");

  const handleContext = (e) => {
    console.log('Typed => ${e.target.value}');
    setContext(e.target.value);
  }
  const handleName = (e) => {
    console.log('Typed => ${e.target.value}');
    setName(e.target.value);
  }

  return (
    <Fragment>
      <div className="mainGrid">
        <form className="inputForm">
          <div className="rowNameDate">
            <RowName value={name} onChange={handleName} />
            <RowDate />
          </div>
          <RowContext value={context} onChange={handleContext} />
        </form>
        <SendBtn />
      </div>
    </Fragment>
  );
}

export default App;
